import React, { useState, useEffect, useCallback } from "react";
import clsx from "clsx";
import PropTypes from "prop-types";
import PerfectScrollbar from "react-perfect-scrollbar";
import { Box, Card, CardHeader, Divider, makeStyles } from "@material-ui/core";
// import GenericMoreButton from "src/components/GenericMoreButton";
import Chart from "./Chart";

const useStyles = makeStyles(() => ({
	root: {},
	chart: {
		height: 400,
	},
}));

function FinancialStats({ className, organizations, count_1, count_2, count_3, ...rest }) {
	const classes = useStyles();
	// const stats = {
	// 	thisYear: [18, 16, 5, 8, 3, 14, 14, 16, 17, 19, 18, 20],
	// 	lastYear: [12, 11, 4, 6, 2, 9, 9, 10, 11, 12, 13, 13],
	// };

	const stats = [count_1, count_2, count_3];
	const labels = [
		// 'Jan',
		// 'Feb',
		// 'Mar',
		// 'Apr',
		// 'May',
		// 'Jun',
		// 'Jul',
		// 'Aug',
		// 'Sep',
		// 'Oct',
		// 'Nov',
		// 'Dec'
	];

	const [titles, setTitles] = useState([]);
	// console.log(titles);
	const getTitles = useCallback(() => {
		setTitles(organizations);
	}, []);

	useEffect(() => {
		getTitles();
	}, [getTitles]);

	titles.map((title) => {
		labels.push(title.title);
	});

	console.log(0, labels, stats);

	return (
		<Card className={clsx(classes.root, className)} {...rest}>
			{/* <CardHeader action={<GenericMoreButton />} title="Financial Stats" /> */}
			<CardHeader title="Financial Stats" />
			<Divider />
			<PerfectScrollbar>
				<Box minWidth={700} pt={4} pr={2} pl={2}>
					{/* <Chart className={classes.chart} data={stats} labels={labels} /> */}
					<Chart className={classes.chart} data={stats} labels={labels} />
				</Box>
			</PerfectScrollbar>
		</Card>
	);
}

FinancialStats.propTypes = {
	className: PropTypes.string,
};

export default FinancialStats;
